import Card from "../UI/Card";
import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

export default function Expenses({ expenses }) {
  return (
    <>
      <ExpenseFilter />
      <Card className="expenses">
        {expenses.map((expense) => {
          return <ExpenseItem key={expense.id} {...expense} />;
        })}
      </Card>
    </>
  );
}
